<!DOCTYPE html>
<html>

<head>
  <style>
    body {
      min-width: 470px;
      min-height: 300px;
      background-color: #2f3136;
    }

    table,
    th,
    td {
      border: 4px solid black;
    }

    ul {
      margin: 3px 0;
      padding: 0;
      width: 100%;
      list-style: none;
      display: grid;
      grid-template-columns: repeat(4, 1fr);
    }

    li {
      position: relative;
    }

    img {
      width: 100px;
      object-fit: cover;
    }

    #myInput {
      background-color: #202225;
      color: white;
      width: 100%;
      font-size: 16px;
      padding: 12px 20px 12px 20px;
      border: none;
      border-radius: 8px;
      margin-bottom: 12px;
      margin-right: 20px;
    }

    #loader {
      display: none;
      margin-left: auto;
      margin-right: auto;
      width: 120px;
      height: 120px;
      animation: spin 2s linear infinite;
    }


    @keyframes spin {
      0% {
        transform: rotate(0deg);
      }

      100% {
        transform: rotate(360deg);
      }
    }

    /* width */
    ::-webkit-scrollbar {
      width: 10px;
    }

    /* Track */
    ::-webkit-scrollbar-track {
      background: #00000000;
    }

    /* Handle */
    ::-webkit-scrollbar-thumb {
      background: rgb(83, 83, 83);
      border-radius: 8px;
    }
  </style>
</head>
